import PySimpleGUI as sg
from pyunpack import Archive
import os

tipos = list()

path = os.path.dirname(os.path.realpath(__file__))
textoComFormatos = f'formatos.txt'

formatos = os.path.join(path,textoComFormatos)

with open(formatos, 'r') as file:    
    tipos.append(file.read().split(','))


def descompactar(filename, directory):
    try:
        Archive(filename).extractall(directory)
        sg.popup_timed('Arquivos descompactados')
    except Exception as e:
        sg.popup_error(e)
        
image = b''

sg.theme('Reddit')

layout = [
    [sg.Stretch(), sg.Image(image, size=(130, 130)), sg.Stretch()],
    [sg.Stretch(), sg.Button('Abrir Arquivo', font=('Verdana', 16), size = (12, 3)), sg.Stretch()],
    [sg.Stretch(), sg.Button('Cancelar', font=('Verdana', 16), size = (12, 3)), sg.Stretch()],
    [sg.Stretch(), sg.Text(f'Formatos Suportados:'),
     sg.Listbox(tipos[0], size=(15, 3)), sg.Stretch()]]


window = sg.Window('Descompactador Universal', layout, resizable=True)

while True:
    event, values = window.read()
    
    if event == sg.WINDOW_CLOSED or event in ('Cancelar', 'Cancel'):
        break
    elif event in 'Abrir Arquivo':
        try:
            file = sg.popup_get_file('Escolha o arquivo para descompactar',
                   file_types=(("Compactadas","*.zip *.7z *.gz"),
                               ("Outras", "*.*"),))        
        
            filename = f'{os.path.normpath(os.path.realpath(file))}'
            directory = sg.popup_get_folder('Escolha onde quer salvar:')
            
            descompactar(filename, directory)
            
        except Exception as e:
            sg.popup_error(e)            
          
        
window.close()
    

